import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Card, Button, Alert, ProgressBar, Form } from 'react-bootstrap';
import axios from 'axios';

const Dashboard = () => {
  const [resume, setResume] = useState(null);
  const [analysis, setAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleFileUpload = async (event) => {
    const file = event.target.files[0];
    if (file && file.type === 'application/pdf') {
      setResume(file);
      setError('');
    } else {
      setError('Please select a valid PDF file');
    }
  };

  const analyzeResume = async () => {
    if (!resume) return;

    setLoading(true);
    setError('');

    try {
      const formData = new FormData();
      formData.append('file', resume);

      const response = await axios.post('http://localhost:8080/api/resume/analyze', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        }
      });

      setAnalysis(response.data);
    } catch (err) {
      setError('Failed to analyze resume. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container className="mt-4">
      <Row>
        <Col>
          <h2 className="text-center mb-4">Resume Analyzer Dashboard</h2>

          {error && <Alert variant="danger">{error}</Alert>}

          <Card className="mb-4">
            <Card.Header>
              <h5>Upload Your Resume</h5>
            </Card.Header>
            <Card.Body>
              <Form.Group>
                <Form.Control
                  type="file"
                  accept=".pdf"
                  onChange={handleFileUpload}
                  className="mb-3"
                />
                <Button
                  onClick={analyzeResume}
                  disabled={!resume || loading}
                  variant="primary"
                  className="w-100"
                >
                  {loading ? 'Analyzing...' : 'Analyze Resume'}
                </Button>
              </Form.Group>
            </Card.Body>
          </Card>

          {analysis && (
            <Row>
              <Col md={6}>
                <Card className="mb-4">
                  <Card.Header>
                    <h5>Resume Score</h5>
                  </Card.Header>
                  <Card.Body>
                    <div className="text-center">
                      <h3 className="text-primary">{analysis.score}/100</h3>
                      <ProgressBar now={analysis.score} className="mb-3" />
                      <p>{analysis.feedback}</p>
                    </div>
                  </Card.Body>
                </Card>
              </Col>

              <Col md={6}>
                <Card className="mb-4">
                  <Card.Header>
                    <h5>Predicted Field</h5>
                  </Card.Header>
                  <Card.Body>
                    <h4 className="text-success">{analysis.predictedField}</h4>
                    <p>Based on your skills and experience</p>
                  </Card.Body>
                </Card>
              </Col>

              <Col md={12}>
                <Card className="mb-4">
                  <Card.Header>
                    <h5>Recommended Skills</h5>
                  </Card.Header>
                  <Card.Body>
                    <div className="d-flex flex-wrap gap-2">
                      {analysis.recommendedSkills?.map((skill, index) => (
                        <span key={index} className="badge bg-secondary">
                          {skill}
                        </span>
                      ))}
                    </div>
                  </Card.Body>
                </Card>
              </Col>
            </Row>
          )}
        </Col>
      </Row>
    </Container>
  );
};

export default Dashboard;
